post_text:
Come learn more about dual language at Vida! Children are invited to attend, and will have the opportunity to read, play, and create with Vida teachers.
//
¡Ven a aprender más sobre el idioma dual en Vida! Los niños también están invitados y tendrán la oportunidad de leer, jugar y crear con los maestros de Vida.

Due to weather conditions tomorrow, the Informative Immigration Session will be rescheduled. We will send home and post updated information as soon as possible.

//

Debido a las condiciones climáticas de mañana, reprogramamos la Sesión de Información de Migración. Enviaremos a casa y publicaremos información actualizada tan pronto como sea posible.

